import React from 'react';
import './navbar.css';
import { Link } from "react-router-dom";
export default function NavBar(){
    return(
        <div className='nav'>
            <ul className='navbar'>
                <li className='nav-bar'>
                    <Link to='/'>
                        Home
                    </Link>
                </li>
                <li className='nav-bar'>
                    <Link to='/About'>
                        About
                    </Link>
                </li>
                <li className='nav-bar'>
                    <Link to='/Contact' className='nav-bar'>
                        Contact
                    </Link>
                </li>
            </ul>
        </div>
    );
}
